<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>AccioQR</title>
    <link href="https://fonts.googleapis.com/css2?family=Cinzel:wght@700&family=Cormorant:wght@400;600&display=swap" rel="stylesheet">
    <script src="https://cdn.jsdelivr.net/npm/qrcode@1.5.1/build/qrcode.min.js"></script>
    <style>
        :root {
            /* House Colors */
            --gryffindor-red: #740001;
            --gryffindor-gold: #d3a625;
            --slytherin-green: #1a472a;
            --slytherin-silver: #aaaaaa;
            --ravenclaw-blue: #0e1a40;
            --ravenclaw-bronze: #946b2d;
            --hufflepuff-yellow: #ffdb00;
            --hufflepuff-black: #000000;
            
            /* Magical Elements */
            --parchment: #f5e7c1;
            --spell-gold: rgba(211, 166, 37, 0.7);
            --spell-silver: rgba(170, 170, 170, 0.7);
            --ink: #2a0c4e;
            --hogwarts-dark: #0f172a;
        }

        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            color: white;
            font-family: 'Cormorant', serif;
            min-height: 100vh;
            display: flex;
            justify-content: center;
            align-items: center;
            padding: 20px;
            overflow-x: hidden;
            position: relative;
            background: linear-gradient(-45deg, #0f172a, #1a1a2e, #16213e, #0f172a);
            background-size: 400% 400%;
            animation: gradientShift 15s ease infinite;
        }

        @keyframes gradientShift {
            0% { background-position: 0% 50%; }
            50% { background-position: 100% 50%; }
            100% { background-position: 0% 50%; }
        }

        /* Floating Golden Snitches */
        .golden-snitch {
            position: fixed;
            width: 30px;
            height: 30px;
            background: url('https://ibb.co/KjFRLcf4') no-repeat center center;
            background-size: contain;
            filter: drop-shadow(0 0 8px rgba(211, 166, 37, 0.8));
            animation: floatSnitch 15s infinite linear;
            z-index: -1;
            opacity: 0.8;
        }

        @keyframes floatSnitch {
            0% { transform: translate(0, 0) rotate(0deg); }
            25% { transform: translate(50vw, 25vh) rotate(90deg); }
            50% { transform: translate(80vw, 50vh) rotate(180deg); }
            75% { transform: translate(30vw, 75vh) rotate(270deg); }
            100% { transform: translate(0, 0) rotate(360deg); }
        }

        /* Spell Sparkles */
        .spell-sparkle {
            position: fixed;
            width: 6px;
            height: 6px;
            background: var(--gryffindor-gold);
            border-radius: 50%;
            filter: blur(1px);
            animation: sparkleFloat 5s infinite ease-in-out;
            z-index: -1;
        }

        @keyframes sparkleFloat {
            0%, 100% { transform: translateY(0) scale(1); opacity: 0; }
            50% { transform: translateY(-100px) scale(1.5); opacity: 0.8; }
        }

        /* Main Container */
        .container {
            width: 100%;
            max-width: 600px;
            background: rgba(15, 23, 42, 0.85);
            backdrop-filter: blur(12px);
            border-radius: 20px;
            padding: 40px;
            box-shadow: 
                0 10px 30px rgba(0, 0, 0, 0.5),
                inset 0 0 20px rgba(211, 166, 37, 0.3);
            border: 3px solid var(--gryffindor-gold);
            position: relative;
            overflow: hidden;
            transform: translateY(20px);
            opacity: 0;
            animation: fadeInUp 1s forwards 0.3s;
        }

        @keyframes fadeInUp {
            to { transform: translateY(0); opacity: 1; }
        }

        /* Header */
        .header {
            text-align: center;
            margin-bottom: 30px;
            position: relative;
        }

        h1 {
            font-family: 'Cinzel', serif;
            font-size: 3rem;
            background: linear-gradient(to right, var(--gryffindor-gold), var(--ravenclaw-bronze));
            -webkit-background-clip: text;
            background-clip: text;
            color: transparent;
            text-shadow: 0 2px 4px rgba(0, 0, 0, 0.3);
            margin-bottom: 10px;
            letter-spacing: 1px;
        }

        .subtitle {
            color: var(--parchment);
            font-size: 1.2rem;
            max-width: 100%;
            margin: 0 auto;
            line-height: 1.5;
        }

        /* QR Display */
        .qr-display {
            display: flex;
            flex-direction: column;
            align-items: center;
            position: relative;
            margin-bottom: 30px;
        }

        .qr-container {
            width: 300px;
            height: 300px;
            background: var(--parchment);
            border-radius: 15px;
            padding: 20px;
            border: 3px solid var(--gryffindor-gold);
            box-shadow: 
                inset 0 0 20px rgba(0, 0, 0, 0.1),
                0 5px 15px rgba(0, 0, 0, 0.3);
            position: relative;
            overflow: hidden;
            transition: transform 0.3s, box-shadow 0.3s;
        }

        .qr-container:hover {
            transform: translateY(-5px);
            box-shadow: 
                inset 0 0 20px rgba(0, 0, 0, 0.1),
                0 8px 25px rgba(0, 0, 0, 0.4);
        }

        #qrcode {
            width: 100%;
            height: 100%;
            display: flex;
            justify-content: center;
            align-items: center;
            background: white;
            border-radius: 8px;
            position: relative;
            overflow: hidden;
        }

        .placeholder-img {
            width: 100%;
            height: 100%;
            object-fit: contain;
        }

        /* Input Section */
        .input-section {
            margin-bottom: 30px;
        }

        .input-container {
            width: 100%;
            position: relative;
        }

        input {
            width: 100%;
            padding: 15px 20px;
            background: var(--parchment);
            border: 2px solid var(--gryffindor-gold);
            border-radius: 10px;
            font-size: 1rem;
            font-family: 'Cormorant', serif;
            transition: all 0.3s;
            color: var(--ink);
        }

        input:focus {
            outline: none;
            border-color: var(--ravenclaw-bronze);
            box-shadow: 0 0 10px rgba(211, 166, 37, 0.3);
        }

        /* House Colors */
        .house-colors {
            display: flex;
            justify-content: center;
            gap: 15px;
            margin-bottom: 30px;
        }

        .house-option {
            width: 50px;
            height: 50px;
            border-radius: 50%;
            cursor: pointer;
            border: 2px solid transparent;
            transition: all 0.3s;
            position: relative;
            box-shadow: 0 3px 10px rgba(0, 0, 0, 0.2);
        }

        .house-option:hover {
            transform: scale(1.1);
        }

        .house-option.selected {
            border-color: white;
            transform: scale(1.15);
            box-shadow: 0 0 15px rgba(255, 255, 255, 0.7);
        }

        /* Download Button */
        .download-btn {
            width: 100%;
            padding: 15px;
            background: linear-gradient(to right, var(--gryffindor-red), #5e0001);
            color: white;
            border: none;
            border-radius: 10px;
            font-family: 'Cinzel', serif;
            font-size: 1.1rem;
            cursor: pointer;
            transition: all 0.3s;
            display: flex;
            align-items: center;
            justify-content: center;
            gap: 10px;
            box-shadow: 0 3px 10px rgba(0, 0, 0, 0.2);
            position: relative;
            overflow: hidden;
        }

        .download-btn:hover {
            transform: translateY(-3px);
            box-shadow: 0 5px 15px rgba(0, 0, 0, 0.3);
        }

        .download-btn:disabled {
            background: #444;
            cursor: not-allowed;
            transform: none;
            box-shadow: none;
        }

        /* Spell Effect */
        .spell-effect {
            position: absolute;
            width: 100%;
            height: 100%;
            top: 0;
            left: 0;
            background: radial-gradient(circle, var(--spell-gold) 0%, transparent 70%);
            opacity: 0;
            transition: opacity 0.5s;
            pointer-events: none;
            z-index: 5;
        }

        .spell-active {
            opacity: 0.5;
        }

        /* Owl Delivery */
        .owl-delivery {
            position: fixed;
            bottom: -200px;
            right: -200px;
            width: 200px;
            height: 200px;
            background: url('https://i.postimg.cc/WpYqZWyq/Pngtree-harry-potter-snowy-owl-vinyl-12242126.png') no-repeat center center;
            background-size: contain;
            transition: all 2s cubic-bezier(0.18, 0.89, 0.32, 1.28);
            z-index: 100;
            pointer-events: none;
            opacity: 0;
            filter: drop-shadow(0 0 10px rgba(211, 166, 37, 0.7));
        }

        .owl-flying {
            bottom: 80%;
            right: 80%;
            opacity: 1;
        }

        /* Responsive */
        @media (max-width: 768px) {
            .container {
                padding: 20px;
            }
            
            h1 {
                font-size: 2.2rem;
            }
            
            .subtitle {
                font-size: 1rem;
            }
            
            .qr-container {
                width: 250px;
                height: 250px;
            }
        }

        @media (max-width: 480px) {
            .container {
                padding: 15px;
            }
            
            h1 {
                font-size: 1.8rem;
            }
            
            .house-option {
                width: 40px;
                height: 40px;
            }
        }
        #qrcode {
  display: flex !important;
  justify-content: center !important;
  align-items: center !important;
  background: white !important;
}

.placeholder-img {
  max-width: 100% !important;
  max-height: 100% !important;
  object-fit: contain !important;
}

    </style>
</head>

        <div class="input-section">
            <div class="input-container">
                <input type="text" id="magicInput" placeholder="Enter your magical content..." oninput="generateQR()">
            </div>
        </div>
        
        <div class="house-colors">
            <div class="house-option selected" style="background: var(--gryffindor-red);" onclick="setHouse('gryffindor')" title="Gryffindor"></div>
            <div class="house-option" style="background: var(--slytherin-green);" onclick="setHouse('slytherin')" title="Slytherin"></div>
            <div class="house-option" style="background: var(--ravenclaw-blue);" onclick="setHouse('ravenclaw')" title="Ravenclaw"></div>
            <div class="house-option" style="background: var(--hufflepuff-yellow);" onclick="setHouse('hufflepuff')" title="Hufflepuff"></div>
        </div>
        
        <button class="download-btn" id="downloadBtn" disabled onclick="downloadQR()">
            <span>Download</span>
        </button>
    </div>

    <div class="owl-delivery" id="owlDelivery"></div>

    <!-- Sound Effects -->
    <audio id="spellSound" src="sounds/spell.mp3"></audio>
    <audio id="owlSound" src="sounds/owl.mp3"></audio>
    <audio id="successSound" src="sounds/success.mp3"></audio>

    <script>
        // Magical configuration
        const magicalConfig = {
            currentHouse: 'gryffindor',
            currentQR: null,
            debounceTimer: null
        };

        // Initialize the magical environment
        function initializeMagic() {
            createSparkles();
            generateQR(); // Initial generation if there's default content
        }

        // Create random spell sparkles
        function createSparkles() {
            const container = document.getElementById('sparkles-container');
            const sparkleCount = 30;
            
            for (let i = 0; i < sparkleCount; i++) {
                const sparkle = document.createElement('div');
                sparkle.className = 'spell-sparkle';
                sparkle.style.left = `${Math.random() * 100}%`;
                sparkle.style.top = `${Math.random() * 100}%`;
                sparkle.style.animationDelay = `${Math.random() * 5}s`;
                sparkle.style.animationDuration = `${3 + Math.random() * 4}s`;
                container.appendChild(sparkle);
            }
        }

        // Set house color
        function setHouse(house) {
            magicalConfig.currentHouse = house;
            
            // Update selected house
            document.querySelectorAll('.house-option').forEach(option => {
                option.classList.remove('selected');
            });
            event.target.classList.add('selected');
            
            // Regenerate QR if exists
            const input = document.getElementById('magicInput').value;
            if (input) generateQR();
            
            playSound('spellSound');
        }

        // Generate QR with magical effects
        function generateQR() {
            clearTimeout(magicalConfig.debounceTimer);
            const input = document.getElementById('magicInput').value;
            const downloadBtn = document.getElementById('downloadBtn');
            
            if (input) {
                // Show spell effect
                const spellEffect = document.getElementById('spellEffect');
                const container = document.getElementById('mainContainer');
                spellEffect.classList.add('spell-active');
                container.classList.add('spell-cast');
                
                magicalConfig.debounceTimer = setTimeout(() => {
                    createQRCode(input);
                    spellEffect.classList.remove('spell-active');
                    container.classList.remove('spell-cast');
                    downloadBtn.disabled = false;
                }, 500);
                
                playSound('spellSound');
            } else {
                resetQR();
                downloadBtn.disabled = true;
            }
        }

        // Create QR code with magic
        function createQRCode(text) {
            const qrcodeContainer = document.getElementById('qrcode');
            qrcodeContainer.innerHTML = '';
            
            try {
                const colorDark = getHouseColor();
                
                QRCode.toCanvas(text, {
                    color: {
                        dark: colorDark,
                        light: '#ffffff'
                    },
                    errorCorrectionLevel: 'H',
                    width: qrcodeContainer.offsetWidth,
                    margin: 1
                }, (error, canvas) => {
                    if (error) {
                        console.error("QR generation error:", error);
                        qrcodeContainer.innerHTML = '<div class="empty-state">Spell failed! Try different content</div>';
                        return;
                    }
                    
                    canvas.style.width = '100%';
                    canvas.style.height = '100%';
                    qrcodeContainer.appendChild(canvas);
                });
                
            } catch (error) {
                console.error("QR generation error:", error);
                qrcodeContainer.innerHTML = '<div class="empty-state">Spell failed! Try different content</div>';
            }
        }

        // Get house color
        function getHouseColor() {
            switch(magicalConfig.currentHouse) {
                case 'gryffindor': return '#740001';
                case 'slytherin': return '#1a472a';
                case 'ravenclaw': return '#0e1a40';
                case 'hufflepuff': return '#946b2d';
                default: return '#740001';
            }
        }

        // Reset QR display

            const qrcodeContainer = document.getElementById('qrcode');
            qrcodeContainer.innerHTML = `

        // Download QR with owl animation
        function downloadQR() {
            const qrcodeContainer = document.getElementById('qrcode');
            const canvas = qrcodeContainer.querySelector('canvas');
            
            if (!canvas) return;
            
            try {
                const link = document.createElement('a');
                link.download = 'enchanted-qr.png';
                link.href = canvas.toDataURL('image/png');
                link.click();
                
                // Owl animation
                const owl = document.getElementById('owlDelivery');
                owl.classList.add('owl-flying');
                playSound('owlSound');
                
                setTimeout(() => owl.classList.remove('owl-flying'), 2000);
                
            } catch (error) {
                console.error("Download error:", error);
                alert("Error downloading QR code. Please try again.");
            }
        }

        // Play magical sound effects
        function playSound(soundId) {
            const sound = document.getElementById(soundId);
            sound.currentTime = 0;
            sound.play().catch(e => console.log("Sound playback prevented:", e));
        }

        // Initialize when DOM is loaded
        document.addEventListener('DOMContentLoaded', initializeMagic);
    </script>
